pragma solidity >=0.5.4 <0.6.0;

import "./Charger.sol";

contract Register {

    address[] public chargers;

    event ChargerRegistered(address _charger);
    // Also may be implemented array with chargers whose owners lost
    // their security tokens

    // иметь полигон геолокации(пока необязательно)

    function register(address _charger) public {
        chargers.push(_charger);
        emit ChargerRegistered(_charger);
    }

    function showFreeChargers() public view returns(address[] memory) {
        uint24 cnt = 0;
        address[] memory freeChargers = new address[](chargers.length);
        for (uint24 i = 0; i < chargers.length; i++) {
            Charger ch = Charger(chargers[i]);
            if(ch.currentStatus() == Charger.Status.Free) {
                freeChargers[cnt] = chargers[i];
                cnt++;
            }
        }
        address[] memory coolFreeChargers = new address[](cnt);
        cnt = 0;
        for (uint24 i = 0; i < freeChargers.length; i++) {
            if(freeChargers[i] != address(0)) {
                coolFreeChargers[cnt] = freeChargers[i];
                cnt++;
            }
        }
        return coolFreeChargers;
    }

    function showChargers() public view returns(address[] memory) {
        return chargers;
    }
}
